import React from "react";
import photo from "../../Assests/projects/run-buddy.jpg";

function Projects() {
  return (
    <section>
      <h1>Run-Buddy</h1>
      <p>Running App</p>
      <div className="flex-row">
          <a href="">
        <img src={photo} alt="Run Buddy" className="img-thumbnail mx-1" />
        </a>
      </div>
    </section>
  );
}
export default Projects;
